issue.body:
下記のような、エンティティとして典型的な `User` 型を作って ServiceProtocol で利用するとエラーになりました。  [`example/entity-with-id`](https://github.com/sidepelican/CallableKit/tree/example/entity-with-id) に再現できるコードを push してあります。
```swift
public struct User: Identifiable, Sendable, Codable, Hashable {
    public var id: ID
    public var name: String

    public init(id: User.ID, name: String) {
        self.id = id
        self.name = name
    }

    public struct ID: Hashable, RawRepresentable, Sendable, Codable {
        public let rawValue: String
        public init(rawValue: String) {
            self.rawValue = rawValue
        }
        ...
    }
}
```
```swift
public protocol EchoServiceProtocol {
    ...
    func testTypicalType(request: User) async throws -> User
    ...
}
```

